import PageWrapper from "../components/PageWrapper";
import { FaLinkedin, FaGithub, FaEnvelope, FaPhone } from "react-icons/fa";
import { motion } from "framer-motion";

const contactItems = [
  {
    icon: <FaLinkedin size={24} />,
    label: "LinkedIn",
    info: "linkedin.com/in/yourprofile",
    link: "https://linkedin.com/in/yourprofile",
  },
  {
    icon: <FaGithub size={24} />,
    label: "GitHub",
    info: "github.com/yourusername",
    link: "https://github.com/yourusername",
  },
  {
    icon: <FaEnvelope size={24} />,
    label: "Email",
    info: "your@email.com",
    link: "mailto:your@email.com",
  },
  {
    icon: <FaPhone size={24} />,
    label: "Phone",
    info: "+39 123 456 7890",
    link: "tel:+391234567890",
  },
];

export default function Contact() {
  return (
    <PageWrapper>
      <section className="min-h-screen bg-white py-20 px-6 md:px-20 text-center">
        <h2 className="text-3xl font-bold text-blue-600 mb-12">Contact Me</h2>

        <div className="grid gap-6 md:grid-cols-2 max-w-4xl mx-auto">
          {contactItems.map((item, index) => (
            <motion.a
              key={index}
              href={item.link}
              target="_blank"
              rel="noreferrer"
              whileHover={{ scale: 1.05, backgroundColor: "#ebf8ff" }}
              className="flex items-center gap-4 bg-gray-50 p-6 rounded-lg shadow-md border border-gray-200 hover:shadow-lg transition-all"
            >
              <div className="text-blue-600">{item.icon}</div>
              <div className="text-left">
                <p className="font-semibold">{item.label}</p>
                <p className="text-gray-600 text-sm">{item.info}</p>
              </div>
            </motion.a>
          ))}
        </div>
      </section>
    </PageWrapper>
  );
}
